private fun supplierOf(supplierName: String, eventTarget: String): Supplier =
    Supplier(supplierName, mapOf("__EVENTTARGET" to eventTarget, "__EVENTARGUMENT" to ""))

private fun pageOf(pageIndex: Int, eventTarget: String? = null, eventArgument: String? = null): Page =
    if (eventTarget == null || eventArgument == null) {
        Page(pageIndex, emptyMap())
    } else {
        Page(pageIndex, mapOf("__EVENTTARGET" to eventTarget, "__EVENTARGUMENT" to eventArgument))
    }
